import React from 'react';
import { 
  Box, 
  Typography, 
  Card, 
  CardContent, 
  List, 
  ListItem, 
  ListItemText,
  Button 
} from '@mui/material';

const ResultsSection = ({ results, onReset }) => {
  const { text, found_substances = [] } = results;

  return (
    <Card sx={{ maxWidth: 600, mx: 'auto', p: 2 }}>
      <CardContent>
        <Typography variant="h4" color="primary" align="center" gutterBottom>
          Analysis Results
        </Typography>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6">Extracted Text:</Typography>
          <Typography 
            variant="body1" 
            sx={{ 
              p: 2, 
              bgcolor: 'background.default', 
              borderRadius: 2 
            }}
          >
            {text || 'No text extracted'}
          </Typography>
        </Box>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6">Detected Substances:</Typography>
          {found_substances.length > 0 ? (
            <List>
              {found_substances.map((substance, index) => (
                <ListItem 
                  key={index} 
                  divider={index < found_substances.length - 1}
                  sx={{ 
                    bgcolor: index % 2 ? 'background.default' : 'white' 
                  }}
                >
                  <ListItemText primary={substance} />
                </ListItem>
              ))}
            </List>
          ) : (
            <Typography variant="body2" color="textSecondary">
              No banned substances detected
            </Typography>
          )}
        </Box>

        <Box textAlign="center">
          <Button 
            variant="contained" 
            color="primary" 
            onClick={onReset}
          >
            Upload Another Image
          </Button>
        </Box>
      </CardContent>
    </Card>
  );
};

export default ResultsSection;
